function renderSnake() {
    $('.td_pseudo_class').removeClass('snakeCell snakeHead');
    for (var cell in snakeCells) {
        $('.tr_pseudo_class').eq(snakeCells[cell][0]).find('.td_pseudo_class').eq(snakeCells[cell][1]).addClass('snakeCell');
    }
    $('.tr_pseudo_class').eq(snakeHead[0]).find('.td_pseudo_class').eq(snakeHead[1]).addClass('snakeHead');
}
function getFruitCell() {
  fruitCell = [getRandomNumber($('.tr_pseudo_class').length), getRandomNumber($('.tr_pseudo_class:eq(0)>.td_pseudo_class').length)];
}
function gameOver() {
    $('div.gameOver').fadeIn('slow', function() {
        $(this).animate({
            bottom: 223
        }, 'slow');
        gameover = true;
    });
    if (sfx_on){
        play_game_over();
    }
    clearInterval(ticker);
    snakeNewHead = snakeHead = [2, 6];
    newCell = [];
    snakeCells = snakeCells = [[2, 6], [2, 5], [2, 4], [2, 3], [2, 2]];
    fruitCell = [];
    getFruitCell();
    renderFruitCell();
    score = 0;
    speed = 150;
    direction = 'right';
    starting = false;
}
function updateSnakeCell() {
    var snakeNewHead = [];
    var newCell = { length: 0 };
    switch (direction) {
        case 'right':
            snakeNewHead = [snakeHead[0], snakeHead[1] + 1];
        break;
        case 'left':
            snakeNewHead = [snakeHead[0], snakeHead[1] - 1];
        break;
        case 'up':
            snakeNewHead = [snakeHead[0] - 1, snakeHead[1]];
        break;
        case 'down':
            snakeNewHead = [snakeHead[0] + 1, snakeHead[1]];
        break;
    }
    if (snakeNewHead[0] < 0 || snakeNewHead[1] < 0) {
        gameOver();
        return;
    }
    else if (snakeNewHead[0] >= size || snakeNewHead[1] >= size) {
        gameOver();
        return;
    }
    var newCell = $('.tr_pseudo_class').eq(snakeNewHead[0]).find('.td_pseudo_class').eq(snakeNewHead[1]);
    if (newCell.length == 0) {
        gameOver();
    }
    else {
        if (newCell.hasClass('snakeCell')) {
            gameOver();
        }
        else {
            if (newCell.hasClass('fruitCell')) {
                snakeCells.push([]);
                getFruitCell();
                renderFruitCell();
                if (sfx_on){
                    play_success_snd();
                }
                score += 10;
                $('#scoreBoard').html(language_array[3] + ' : ' + score);
                if (localStorage.getItem("snake_highscore")==null || localStorage.getItem("snake_highscore") < score){
                    $('#HighscoreBoard').html(language_array[2] + ' : ' + score);
                    localStorage.setItem("snake_highscore", score);
                }
                speed = speed - 2 > 50 ? speed - 2 : speed;
                clearInterval(ticker);
                startGame();
            }
            for (var i = (snakeCells.length - 1); i > 0; i--) {
                snakeCells[i] = snakeCells[i - 1];
            }
            snakeCells[0] = snakeHead = snakeNewHead;
            renderSnake();
        }
    }
}
function play_success_snd(){
    let myAudio = new Audio('./audio/knight-right-footstep-on-gravel-4-with-chainmail-101937.mp3');
    myAudio.volume = 0.2;
    myAudio.play();
}
function play_game_over(){
    let myAudio = new Audio('./audio/game-over-arcade-6435.mp3');
    myAudio.volume = 0.4;
    myAudio.play();
}
function play_background(){
    myBGAudio = new Audio('./audio/8-bit-moonlight-sonata-music-loop-20436.mp3');
    myBGAudio.volume = 0.1;
    myBGAudio.loop = true;
    myBGAudio.play();
}
function getRandomNumber(limit) {
    return parseInt(Math.random() * limit % limit);
}
function getNewDirection(keyCode) {
    var codes = {
        37: 'left',
        38: 'up',
        39: 'right',
        40: 'down'
    };
    if (typeof codes[keyCode] != 'undefined') {
        var newDirection = codes[keyCode], changeDirection = true;
        switch (direction) {
            case 'up':
                changeDirection = newDirection != 'down';
            break;
            case 'down':
                changeDirection = newDirection != 'up';
            break;
            case 'right':
                changeDirection = newDirection != 'left';
            break;
            case 'left':
                changeDirection = newDirection != 'right';
            break;
        }
        direction = changeDirection ? newDirection : direction;
    }
}
function renderBoard() {
    var rowhtml = '';
    for (var i = 0; i < size; i++) {
        rowhtml += '<td cellpadding="0" cellspacing="0" class="td_pseudo_class"></td>'
    }
    html = [];
    for (var i = 0; i < size; i++) {
        html.push('<tr cellpadding="0" cellspacing="0" class="tr_pseudo_class">' + rowhtml + '</tr>');
    }
    $("#snake_bgd").append('<table id="gamefield">' + html.join('\n') + '</table>');
    getFruitCell();
}
function renderFruitCell() {
    $('.td_pseudo_class').removeClass('fruitCell');
    $('.tr_pseudo_class').eq(fruitCell[0]).find('.td_pseudo_class').eq(fruitCell[1]).addClass('fruitCell');
}
function startGame() {
    ticker = setInterval(updateSnakeCell, speed);
    starting = true;
}